import React from 'react';
import {Chart} from 'react-google-charts'

export const data = [
    ["Task", "Hours per Day"],
    ["Work", 11],
    ["Eat", 2],
    ["Commute", 2],
    ["Watch TV", 2],
    ["Sleep", 7],
  ];

  export const options = {
    title: "My Daily Activities",
  };


function leitos () {
    return(
        <div className='leitos'>
            <header><h2>PÃ¡gina de Leitos</h2></header>
            <div className='chart'>
            <Chart
            chartType="PieChart"
            data={data}
            options={options}
            width={"100%"}
            height={"400px"}
            />
            </div>
        </div>
    );
}

export default leitos;
